import React, { PureComponent } from 'react'
import { Button, Table } from 'antd'
import 'antd/dist/antd.min.css'
import './UserList.css'
export default class UserList extends PureComponent {
    constructor(){
        super()
    }
    users=[
        {
            firstName:"Robin",
            lastName:"Singh",
            age:23,
            phone:67384894
        },
        {
            firstName:"Robin",
            lastName:"Singh",
            age:23,
            phone:67384894
        },
    ]

    columns=[
        {
            title: 'FirstName',
            dataIndex: 'firstName',
            key: 'firstName',
          },
          {
            title: 'LastName',
            dataIndex: 'lastName',
            key: 'lastName',
          },
          {
            title: 'Age',
            dataIndex: 'age',
            key: 'age',
          },
          {
            title: 'Phone',
            dataIndex: 'phone',
            key: 'phone',
          },
    ]
  render() {
    return (
      <div className='main-container'>
        <Button className="add-button">Add User</Button>
        <Table dataSource={this.users} columns={this.columns} >

        </Table>
      </div>

    )
  }
}
